<head>

    <title>Document</title>
    <style>
        .container {
            background-color: rgb(1, 204, 240);
            display: grid;
            gap: 10px;
            grid-template-areas:
                " header  header "
                " aside  main "
                " aside  main "
                " aside  main   "
                "footer footer"
            ;
            height: 70px;
            grid-template-columns: repeat(2,585px);
        }

        .container>div {
            justify-content: flex-start;
            display: flex;
            padding-right: 1000px;
            margin: 10px;
            font-size: 30px;
            

        }

        .container>.header {
            display: flex;
            grid-area: header;
            
            left: 0;
            align-items: flex-end;
        }
        .header>.nav{
            display: flex;
            margin-left: 750px;
            gap: 20px  ;
            color: white;
            font-size: 20px;
        }

        .container>.main {
            display: grid;
            grid-area: main;
        }

        .container>.aside {
            border: 20px solid rgba(128, 112, 112, 0.575);
            justify-content: center;
            grid-area: aside;
            background-color: rgb(88, 80, 80);

        }

        .container>.footer {
            grid-area: footer;
        }
    </style>
</head>
